import Header from "../Header/Header";
import "./Header.css"
// import { Link } from "react-router-dom";

function CreatePage(){
    return (
        <div class="container">
            <Header />
        <div class="content">
        <div class="text-content">
            <h3 class="new-task">
                Жаңа тапсырма
            </h3>
        </div>
        
        {/* <!-- <div class="main-content"> --> */}
            <form id="#my-form">
                <input type="text" placeholder="Тақырып" class="input" id="my-input"/ >
              </form>
            
        <div class="buttons" id="buttons">
            {/* <a href="#">
                <button id="button1">
                    Қосу
                </button>
            </a>  */}
            <form>
                <input type="button" value="Қосу" id="button1" />
            </form>
            <a href="2.html">
                <button id="button2">
                    Қоспау
                </button>
            </a>
            {/* <!-- <form>
                <input type="submit" value="Қоспау" id="button2" />
            </form> --> */}
        </div>
        </div>
    </div> 
    );
}

export default CreatePage;
